import React, { useState } from 'react';
import Cookies from 'universal-cookie';


const Profile = () => {
    const cookies = new Cookies();
    

    
    const cookieData = cookies.get('cookie')// Pacman
    
    const deleteCookie = () => {
        cookies.remove('cookie', {path: '/'});
    }
    return(
        <>
            {cookieData ? (
                <>
                    <p>{cookieData.name}</p>
                    <p>{cookieData.lastname}</p>
                    <p>{cookieData.ticketNumber}</p>
                </>
                
            ): (
                ""
            )}
        <button onClick={deleteCookie} className='btn btn-primary'>Remove cookie</button>
        </>
    )
}

export default Profile;
